    "2013-03-16T00:12:02.080643",nt"name": "geology-of-the-lunenburg-brunswick-guildhall-area-vermont",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Bedrock map, Tectonic map, Cross
    Section image, and a text on the Bedrock geology for the the Lunenburg-Brunswick-Guildhall
    area, Vermont.nAbstract: The Lunenburg-Brunswick-Guildhall area is situated in the
    southern half of Essex County in northeastern Vermont and belongs to the western
    portion of the White Mountain section of the New England physiographic province.
     About 70 per cent of the area's bedrock consists of various metasediments, clearly
    indicating increased intensity of regional metamorphism toward the northwest. Metasedimentary
    rock units of both the "New Hampshire sequence" and "Vermont sequence" are present.
    They are separated by the controversial Monroe fault which strikes northeasterly
    from Granby to the Connecticut River in southern Brunswick.",nt"license_title":
